Product Description
To compile this book, editor Jonathan Eisen traveled the world in search of documented stories of scientific cover-ups, covert operations, and programs of deliberate misinformation, all designed to hide controversial inventions and discoveries, such as anti-gravity devices, limitless energy sources, results of cancer and AIDS research, and more. 40 photos. 30 illustrations. --This text refers to an out of print or unavailable edition of this title.
